import React from 'react';
import {
    Grid,
    GridItem,
    Input,
    Stack,
    Center,
    Text
} from "@chakra-ui/react"
import Search from '../Components/Search';


export default function SearchPage() {


    return (
        <div>
            <Grid h="200px" templateRows="repeat(2, 1fr)" templateColumns="repeat(5, 1fr)"
                gap={4}>
                <GridItem rowSpan={2}
                    colSpan={1}
                    bg="tomato"/>

                <GridItem colSpan={4}
                    bg="tomato"/>
            </Grid>
        </div>
    );
}
